import {
  BrowserRouter,
  Route,
} from "react-router-dom";

import './App.css';
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Route path="/" exact element={<NotesListPage />} />
      </div>
    </BrowserRouter>
  );
}

export default App;
